export function addProjeto(title,images,author,description){
  if(projetos.some((projeto) => projeto.title === title)){
    throw Error(`Projeto com o nome ${title} j existe`)
  }
  else{
    projetos.push(new Projeto(title,images,author,description))
    localStorage.setItem("projetos", JSON.stringify(projetos))
  }
}

export function removeProjeto(title){
  projetos = projetos.filter((projeto) => projeto.title !== title)
  localStorage.setItem("projetos", JSON.stringify(projetos))
}

export function getProjetos(){
  return projetos
}

export function setCurrentProjeto(title){
  localStorage.setItem("projeto", title)
}

export function getCurrentProjeto(){
  return projetos.find((projeto) => projeto.title === localStorage.getItem("projeto"))
}

export function getProjetoByTitle(title){
  return projetos.find((projeto) => projeto.title === title)
}

export function getCurrentDate(){
  return new Date().toJSON().slice(0, 10)
}

export class Projeto{

  addedDate = getCurrentDate()

  constructor(title,images,author,description){
    this.title = title
    this.images = images
    this.author = author
    this.description = description
  }
}